import { useState } from "react";
import "../styles/Main.scss";
import { Link } from "react-router-dom";

function Main() {

	const [name, setName] = useState("")

	return (
		<form>
		  <input
			type="text"
			value={name}
			onChange={(e) => setName(e.target.value)}
			placeholder="Full name"
			aria-label="fullname"
		  />
		  <input type="submit" value="Submit"></input>
		</form>
	  );

	return (
		<div>
			<Link to={"/movies"}>
				<p>{name}</p>
			</Link>
		</div>
	);
}

export default Main;
